function skProgressBar(value:number, max:number, length: integer, c:text, p:text, r:text, fullbar:text="")::string:
    set {_percentage} to max(({_value} / {_max}), 0)
    set {_completion} to {_percentage} * {_length}
    set {_bar} to ""
    set {_icons1} to floor({_completion})
    set {_icons2} to floor({_length} - {_icons1})

    if {_percentage} < 1:
        loop {_icons1} times:
            set {_bar} to "%{_bar}%%{_c}%"
        set {_bar} to "%{_bar}%%{_p}%"
        loop ({_icons2}-1) times:
            set {_bar} to "%{_bar}%%{_r}%"
    else:
        if {_fullbar} = "":
            loop {_length} times:
                set {_bar} to "%{_bar}%%{_c}%"
        else:
            set {_bar} to {_fullbar}

    return formatted {_bar}

